fields.text_value:
Электрический самокат Kugoo S3 является самой младшей моделью скутеров от завода Jilong. Транспортное средство действительно стало популярным. Покупатели оценили его надежность, качество и приемлемую стоимость.

Электросамокат имеет небольшой вес и габариты, позволяющие не только кататься на нем, но и ездить с комфортом в общественном транспорте. Колеса скутера изготовлены из цельной резины, спереди и сзади установлены пружинные амортизаторы. Мощность «движка» составляет 350 Вт. Этого достаточно, чтобы развить скорость до 30 км/час. Оригинальный самокат от Kugoo выпускается в черном, белом и сером цвете. Рассчитан на ездоков весом не более 120 килограммов.

В комплектацию к транспорту входят:
Зарядное устройство;
Инструкция;
Сумка для переноски;
Гарантийный талон;
Сервисная книжка.
Рассмотрим подробнее каждую характеристику устройства. Выделим положительные свойства самоката.

